[{"location":"generated/tutorials/gettingstarted/","page":"Getting Started","title":"Getting Started","text":"EditURL = \"../../../literate/tutorials/gettingstarted.jl\"","category":"page"},{"location":"generated/tutorials/gettingstarted/","page":"Getting Started","title":"Getting Started","text":"Getting started","category":"page"},{"location":"generated/tutorials/gettingstarted/#this-is-a-markdown-headline","page":"Getting Started","title":"this is a markdown headline","text":"","category":"section"},{"location":"generated/tutorials/gettingstarted/","page":"Getting Started","title":"Getting Started","text":"# this is a code comment\n\n1 == 1","category":"page"},{"location":"generated/tutorials/gettingstarted/","page":"Getting Started","title":"Getting Started","text":"text will make a new code cell with new output_data","category":"page"},{"location":"generated/tutorials/gettingstarted/","page":"Getting Started","title":"Getting Started","text":"bla = \"shaolong shi2\"","category":"page"},{"location":"generated/tutorials/gettingstarted/","page":"Getting Started","title":"Getting Started","text":"","category":"page"},{"location":"generated/tutorials/gettingstarted/","page":"Getting Started","title":"Getting Started","text":"This page was generated using Literate.jl.","category":"page"},{"location":"generated/tutorials/test/","page":"-","title":"-","text":"EditURL = \"../../../literate/tutorials/test.jl\"","category":"page"},{"location":"generated/tutorials/test/","page":"-","title":"-","text":"","category":"page"},{"location":"generated/tutorials/test/","page":"-","title":"-","text":"This page was generated using Literate.jl.","category":"page"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/","page":"Autoencoder EEG Meeting Minutes","title":"Autoencoder EEG Meeting Minutes","text":"EditURL = \"../../../literate/tutorials/Autoencoder_EEG_Meeting_Minutes.jl\"","category":"page"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/#Things-to-learn:","page":"Autoencoder EEG Meeting Minutes","title":"Things to learn:","text":"","category":"section"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/","page":"Autoencoder EEG Meeting Minutes","title":"Autoencoder EEG Meeting Minutes","text":"What is an autoencoder?\nWhat is a deep autoencoder.\nWhat is LSTM.","category":"page"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/#Questions-to-be-asked-to-the-professor:","page":"Autoencoder EEG Meeting Minutes","title":"Questions to be asked to the professor:","text":"","category":"section"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/","page":"Autoencoder EEG Meeting Minutes","title":"Autoencoder EEG Meeting Minutes","text":"Do we have to build an autoencoder from scratch?\nWhat do you mean by improvement?\nDo we have to inculcate LSTM into our Autoencoder?","category":"page"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/#1.-Learning-rate","page":"Autoencoder EEG Meeting Minutes","title":"1. Learning rate","text":"","category":"section"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/","page":"Autoencoder EEG Meeting Minutes","title":"Autoencoder EEG Meeting Minutes","text":"Too high a learning rate might cause the model to oscillate or even diverge during training, leading to poor convergence. This could result in poor quality of the graphics generated by the autoencoder, with significant loss of detail.\nToo low a learning rate might lead to excessively slow training and the model might get stuck in local minima. This could cause the autoencoder to generate overly smooth images that miss some important features.","category":"page"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/#2.-Epoch-Number","page":"Autoencoder EEG Meeting Minutes","title":"2. Epoch Number","text":"","category":"section"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/","page":"Autoencoder EEG Meeting Minutes","title":"Autoencoder EEG Meeting Minutes","text":"Too few epochs might prevent the model from adequately learning the features in the data, affecting the quality and accuracy of the reconstructed graphics.\nToo many epochs might lead to overfitting where the model performs well on the training data but poorly on new, unseen data. An overfitted autoencoder might generate images that are too reliant on specific noise and details of the training data, instead of learning a more general representation of the data.","category":"page"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/#3.-Batch-Size","page":"Autoencoder EEG Meeting Minutes","title":"3. Batch Size","text":"","category":"section"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/","page":"Autoencoder EEG Meeting Minutes","title":"Autoencoder EEG Meeting Minutes","text":"Smaller batch sizes generally provide a more accurate gradient estimation but might lead to a less stable training process and longer training times. Smaller batches might enable the model to learn more details, potentially leading to better performance in image reconstruction tasks.\nLarger batch sizes can speed up training and stabilize gradient estimations but may reduce the generalization ability of the model during training. In autoencoders, too large a batch might result in reconstructed images that lack detail and appear more blurred or smooth.","category":"page"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/#Example-Literate-File","page":"Autoencoder EEG Meeting Minutes","title":"Example Literate File","text":"","category":"section"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/","page":"Autoencoder EEG Meeting Minutes","title":"Autoencoder EEG Meeting Minutes","text":"This is an example of a literate Julia file. You can include code and text together to create documentation.","category":"page"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/#Section-1:-Basic-Arithmetic","page":"Autoencoder EEG Meeting Minutes","title":"Section 1: Basic Arithmetic","text":"","category":"section"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/","page":"Autoencoder EEG Meeting Minutes","title":"Autoencoder EEG Meeting Minutes","text":"Let's start with some basic arithmetic operations.","category":"page"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/","page":"Autoencoder EEG Meeting Minutes","title":"Autoencoder EEG Meeting Minutes","text":"x = 1 + 1\nprintln(\"1 + 1 = \", x)\n\ny = 2 * 3\nprintln(\"2 * 3 = \", y)","category":"page"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/#Section-2:-Using-Functions","page":"Autoencoder EEG Meeting Minutes","title":"Section 2: Using Functions","text":"","category":"section"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/","page":"Autoencoder EEG Meeting Minutes","title":"Autoencoder EEG Meeting Minutes","text":"We can also define and use functions.","category":"page"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/","page":"Autoencoder EEG Meeting Minutes","title":"Autoencoder EEG Meeting Minutes","text":"function greet(name)\n    return \"Hello, $name\"\nend\n\nprintln(greet(\"world\"))","category":"page"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/#Section-3:-Plotting-(requires-Plots.jl)","page":"Autoencoder EEG Meeting Minutes","title":"Section 3: Plotting (requires Plots.jl)","text":"","category":"section"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/","page":"Autoencoder EEG Meeting Minutes","title":"Autoencoder EEG Meeting Minutes","text":"We can include plots as well.","category":"page"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/","page":"Autoencoder EEG Meeting Minutes","title":"Autoencoder EEG Meeting Minutes","text":"","category":"page"},{"location":"generated/tutorials/Autoencoder_EEG_Meeting_Minutes/","page":"Autoencoder EEG Meeting Minutes","title":"Autoencoder EEG Meeting Minutes","text":"This page was generated using Literate.jl.","category":"page"},{"location":"","page":"Home","title":"Home","text":"CurrentModule = DeepRecurrentEncoder","category":"page"},{"location":"#DeepRecurrentEncoder","page":"Home","title":"DeepRecurrentEncoder","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for DeepRecurrentEncoder.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [DeepRecurrentEncoder]","category":"page"},{"location":"#DeepRecurrentEncoder.DRE-Tuple{Int64, Int64, Int64}","page":"Home","title":"DeepRecurrentEncoder.DRE","text":"hidden_chs corresponds to the number of filters in the conv layer & the number of hidden units in the LSTM\n\n\n\n\n\n","category":"method"},{"location":"#DeepRecurrentEncoder.add_mask!-Union{Tuple{T}, Tuple{AbstractArray{T, 3}, AbstractArray{T, 3}, Any}} where T","page":"Home","title":"DeepRecurrentEncoder.add_mask!","text":"returns new array containing eeg with mask or writes the same contents into masked if provided\n\n\n\n\n\n","category":"method"},{"location":"#DeepRecurrentEncoder.add_mask-Tuple{AbstractArray, Any}","page":"Home","title":"DeepRecurrentEncoder.add_mask","text":"returns new array containing eeg with mask or writes the same contents into masked if provided\n\n\n\n\n\n","category":"method"},{"location":"#DeepRecurrentEncoder.add_stimuli-Union{Tuple{T}, Tuple{AbstractArray{T, 3}, AbstractMatrix{T}}} where T","page":"Home","title":"DeepRecurrentEncoder.add_stimuli","text":"eeg is a 3d array of shape (channel, time, epoch)\n\ndesignmatrix is a Matrix with a row discribing the stimuli for each epoch\n\n\n\n\n\n","category":"method"},{"location":"#DeepRecurrentEncoder.prepare_data-Tuple{Any, Any}","page":"Home","title":"DeepRecurrentEncoder.prepare_data","text":"Todo: Can be greatly improved by generating the stimulus matrix once and then masking + add_stimuli :shrug:\n\n\n\n\n\n","category":"method"}]
